  const methods = useForm();
  const { handleSubmit, reset, trigger, control } = methods;
  return (
    <div>
      <TextFieldCustom label="First name" name="firstName" control={control} />
      <br />
      <br />
      <TextFieldCustom label="Last name" name="lastName" control={control} />
    </div>
  );
}
